import React from 'react'
import { Form } from 'react-router-dom'

const HeroForm = () => {
  return (
    <Form>
      <Form.Group className="mb-3" controlId="alias">
      <Form.Label>Hero Alias: </Form.Label>

      </Form.Group>
    </Form>
  )
}

export default HeroForm
